import React, { useEffect, useState } from 'react'
import axios from 'axios'

const baseURL = process.env.REACT_APP_URL

export default function Output() {
  const [output, setOutput] = useState(null)

  const fetchOutputs = async () => {
    try {
      const response = await axios.get(baseURL)
      const outputData = JSON.parse(response.data.data[response.data.data.length - 1].body)
      setOutput(outputData)
      console.log(outputData)
    } catch (error) {
      console.log(error)
    }
  }
  if (output)  var split = JSON.stringify(output.plan.split)
  useEffect(() => {
    fetchOutputs()
  }, [])

  if (!output) return null  // render nothing if output is not available yet

  let splitHtml = "Split:<br/>";
  for (const [day, activity] of Object.entries(output.plan.split)) {
      splitHtml += `${day}: ${activity}<br/>`;
  }


  return (
    <div class="plan">
        <h1 id="planGoal">
        `Goal: ${output.plan.goal}
        </h1>
        <div id="planSplit">
          <p>
          {splitHtml}
          </p>
        </div> 
        <div>

        </div>
        <p id="planExercise">
        Exercise Selection: ${output.plan.exercise_selection}
        </p>
    </div>
  )
}
